import React, { useState } from 'react';
import './prev.css';
import Snackbar, { SnackbarOrigin } from '@mui/material/Snackbar';
import {
  TableBody,
  TableCell,
  TableRow,
  TableHead,
  TableContainer,
  Table,
  Paper
} from '@mui/material';


export default function Preview() {
 
  return (
    <>
      <div className='preview'>
      <Box sx={{ width: '100%' }}>
      <Collapse in={open}>
        <Alert
          action={
            <IconButton
              aria-label="close"
              color="inherit"
              size="small"
              onClick={() => {
                setOpen(false);
              }}
            >
              <CloseIcon fontSize="inherit" />
            </IconButton>
          }
          sx={{ mb: 2 }}
        >
          Close me!
        </Alert>
      </Collapse>
      <Button
        disabled={open}
        variant="outlined"
        onClick={() => {
          setOpen(true);
        }}
      >
        Re-open
      </Button>
    </Box>

        
        <div className='workoutdata'>
          <h1>Workout Preview</h1>
        </div>
      </div>
      
        <div className='table'>
        <TableContainer component={Paper}>
            <Table sx={{ minWidth: 400 }} size="small" aria-label="a dense table" align = 'top'>
            <TableHead>
              <TableRow
                style={{ backgroundColor: 'burlywood', color: 'blue', padding: '15px' }}
              >
                <TableCell>Exercise Name</TableCell>
                <TableCell>Sets</TableCell>
                <TableCell>Reps</TableCell>
                <TableCell>Unit</TableCell>
                <TableCell>Date</TableCell>
              </TableRow>
            </TableHead>
            {/* <TableBody>
                {finalData.map((data) =>(
                    <TableRow key = {data.email}>
                        <TableCellcomponent="th" scope="row">{data.exercisename}</TableCellcomponent=>
                        <TableCell>{data.sets}</TableCell>
                        <TableCell>{data.reps}</TableCell>
                        <TableCell>{data.units}</TableCell>
                        <TableCell>{data.date}</TableCell>
                    </TableRow>
                ))}
            </TableBody> */}
          </Table>
        </TableContainer>
        </div>
    </>
  );
}
